import React from 'react';

import Toolbar from "./Toolbar";
import SideDrawer from "./SideDrawer";
import Backdrop from "./Backdrop";

class App extends Component {

}

const sidenavigation = props => (
    <>
        <Toolbar />
        <SideDrawer />
        <Backdrop />
    </>
);

export default sidenavigation;
